import React from "react";

function Aboutpage() {
  return (
    <>
      <div className="first-about">
        <div className="about-main-container">
          <div className="about-upper">
            <h2>Hi, I'm Rachel Farn!</h2>
            <p>
              I'm a recently graduated Product Design
              <br /> and Human-Computer Interaction student
              <br /> from Carnegie Mellon University.
            </p>
          </div>
          <div className="about-lower"></div>
        </div>
      </div>
    </>
  );
}

export default Aboutpage;
